  \"2016-02-22T22:29:29.780164\",\n\t\"name\": \"ecosystem-monitoring-al9804\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Ecosystem Monitoring (aka Ecomon) survery
  uses bongo and CTD sampling to monitor and map the distribution of zooplankton,
  krill and smaller organisms) and the physical environment. The survey has been conducted
  four times per year (although fewer times in recent years) in each season on the
  continental shelf from Cape Hatteras, NC to the Canadian waters of New Brunswick
  and Nova Scotia. Acoustic data are occasionally collected. Marine mammal and bird
  observations have been collected in the past.\",\n\t\"license_title\": null,\n\t\"extras\":
